import * as React from "react";
import {useState} from 'react';
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginPage.css';
import { Paper, Button, Box, FormControlLabel, Link } from "@mui/material";
import InputAdornment from '@mui/material/InputAdornment';
import axios from "axios";

function LoginPage(){
    const [login, setLogin] = useState('');
    const [password, setPassowrd] = useState('');
    const [passwordConfirm, setPasswordConfirm] = useState('');

    const handleSubmit = (event) =>{
        event.preventDefault();

        console.log(login);
        console.log(password);
        console.log(passwordConfirm);
        // axios.post('register',{
        //     login: 
        // }).then((response) => {
        //     console.log(response);
        // }).catch((error) => {
        //     console.log(error);
        // })
    };
//dodac action i post
    return (<Paper onSubmit={handleSubmit} className="LoginPaper" sx={{width:400}} elevation={3}><Box component="form" action="" method="" sx={{mt:5}} gap={5} display="flex" flexDirection="column" justifyContent="center">
        <h1 className="LogoHeader">Epinote</h1>
        <TextField onChange={event => setLogin(event.target.value)} value={login} required autofocus label="Login" name="login" id="login" sx={{mr:5, ml:5}} variant="standard" size="small"/>

        <Box sx={{mr:5, ml:5, mb:7}} display="flex" justifyContent="space-between" gap={3}> 
            <TextField onChange={event => setPassowrd(event.target.value)} value={password} required label="Password" name="password" id="password" type="password" variant="standard" size="small"/>
            <TextField onChange={event => setPasswordConfirm(event.target.value)} value={passwordConfirm} required label="Confirm" name="passwordConfirm" id="passwordConfirm" type="password" variant="standard" size="small"/>
        </Box>

        <Box sx={{mr:5, ml:5, mb:7}} display="flex" justifyContent="space-between" gap={5}> 
            <Link component={Button} variant="text" underline="none" href='/'>Sign In Instead</Link>
            <Button variant="contained" type="submit">Register</Button>
        </Box>
        </Box></Paper>);
}

export default LoginPage;



